import React, {Component} from 'react';
// import logo from './logo.svg';

import {Card} from 'react-bootstrap';
import Image from 'react-bootstrap/Image';
import MonkeyCard from './monkey-card/monkey-card.js';

class Box extends Component {


    // constructor(props) {
    //   super(props)

    //   this.state = {socialTransfers:null}
    // }

    render() {

    return (
      <Card style={{ width: '18rem' }}>
      	<Card.Img variant="top" src="/assets/image-CD.png" />
      	<Card.Body>
      		<Card.Text>Type of content</Card.Text>
		    <Card.Title>Veggies es bonus vobis, proinde postulo essum magis kohlrabi</Card.Title>
		    <MonkeyCard />
	  	</Card.Body>
      </Card>
    );
  } 
}


export default Box;
